import { useState, useEffect } from 'react';
import Blogs from './components/Blogs';

const App = () => {

  let blogs = [
    {
      title: "test",
      author: "test",
      url: "test",
      likes: "1"
    }
  ]

  const blogit = blogs.map(blog => {
    <p>{blog.title}</p>
  })

  return (
    <div className="App">
      <h1>Blogs</h1>
      {blogs}
      <Blogs />
    </div>
  );
}

export default App
